from PIL import Image
import re
import cv2
import os

def txt2imgv(txt, img_width=426, img_height=240):
    bits = ''
    for i in txt:
        c = str(bin(ord(i))[2:])
        padding = ''
        if len(c) % 8 != 0:
            for j in range(0, 8 - len(c) % 8):
                padding = padding + '0'
        bits = bits + padding + c
    # print(len(bits))

    # calculate total number of pixels required to encode the message
    num_pixels = img_width * img_height
    num_bits = len(bits)

    # calculate number of frames required
    num_frames = (num_bits // num_pixels) + 1 if num_bits % num_pixels != 0 else num_bits // num_pixels

    # iterate over the bits and create frames
    bit_index = 0
    for i in range(num_frames):
        # create a new image for each frame
        img = Image.new('1', (img_width, img_height))
        # iterate over the pixels and set the color based on the bit value
        for y in range(img_height):
            for x in range(img_width):
                if bit_index < num_bits:
                    bit_value = int(bits[bit_index])
                    img.putpixel((x, y), bit_value)
                    bit_index += 1
        # save the image to a file
        img.save(os.path.join('frames', f'frame{i}.png'))
    return num_frames

def generate_video():
    image_folder = 'frames'
    video_name = 'output.avi'
    images = [img for img in os.listdir(image_folder)
              if img.endswith(".jpg") or
                 img.endswith(".jpeg") or
                 img.endswith("png")]

    # print(images) 
  
    frame = cv2.imread(os.path.join(image_folder, images[0]))
    height, width, layers = frame.shape  
  
    video = cv2.VideoWriter(video_name, 0, 1, (width, height)) 
    video.set(cv2.CAP_PROP_BITRATE, 5000000)
    # Appending the images to the video one by one
    for image in images: 
        video.write(cv2.imread(os.path.join(image_folder, image))) 
        os.remove(os.path.join(image_folder, image))

    cv2.destroyAllWindows() 
    video.release()

def get_frames(video_path, fps):
    cap = cv2.VideoCapture(os.path.join('vid',video_path))
    cap.set(cv2.CAP_PROP_FPS, fps)
    
    frames = []
    while True:
        ret, frame = cap.read()
        if not ret:
            break
        frames.append(frame)
    
    cap.release()
    os.remove(os.path.join('vid', video_path))
    return frames

def img2bitsv(name):
    img = Image.fromarray(name.astype('uint8')).convert('1')

    img_width, img_height = img.size
    #print(img_height)
    bits = ''
    for y in range(img_height):
        for x in range(img_width):
            pixel_value = img.getpixel((x, y))
            bits += str(int(pixel_value == 255))
    #print(bits)
    return bits

def bits2txtv(bits):
    if len(bits)%8!=0:
        bits=bits[len(bits)%8:]
    l=re.findall('........',bits)
    s=''
    for i in l:
        s=s+chr(int(i, 2))
    # print('doc generation completed...')
    return s



